const a={a1:"列表控件为列表项提供信息和操作。",a2:"列表控件提供列表项的信息、指示状态或显示操作。列表控件以图标的形式显示在文本左侧或右侧。",a3:"列表控件位置：",a4:"状态和主操作放在列表瓦片的左侧。",a5:"副操作和信息放在瓦片的右侧。",a6:"类型",a7:"复选框<br />开关<br />重新排序<br />展开/折叠<br />滑动隐藏控件",a8:"菜单控件",a9:"选中<br />内联信息<br />嵌套菜单标识",a10:"用法",a11:"列表控件类型",a12:"菜单控件类型",a13:"列表控件分为四类：",a14:"状态",a15:"主操作（包括文本字符串）",a16:"副操作",a17:"副信息",a18:"列表瓦片中容易分辨的元素需要放在左侧，以符合用户从左到右的阅读顺序，反之同理。状态和主操作放在列表瓦片的左侧。列表项中的文本也被认为是主操作的操作目标的一部分。",a19:"不要把两个图标或操作放在一起，例如复选框和头像。",a20:"如果列表项的主要操作是导航，那么就不要使用图标。列表项本身以及它的上下文就足以让用户明白这个列表的用处是什么。",a21:"副操作和信息应该放在标题的右侧。副操作通常要和主操作分开，可以单独点击，因为用户越来越希望每个图标都能触发一个动作。",a22:"状态和主操作放在瓦片的左侧。副操作和副信息放在标题的右侧。",a23:"复选框",a24:"复选框可以作为主操作，也可以作为副操作。",a25:"类型：主操作/状态",a26:"桌面端的复选框应该只在鼠标悬停和获取焦点时显示。",a27:"在这个列表中，复选框是主操作和状态标识符。",a28:"类型：副操作",a29:"单独可点击",a30:"当控制一系列变量，而不仅仅只是控制一个变量的情况下，考虑使用开关控件来代替。",a31:"在这个列表中，复选框是副操作。",a32:"开关",a33:"类型：副操作",a34:"单独可点击",a35:"开关是次要操作，单独可点击。",a36:"重新排序",a37:"类型：副操作",a38:"通常是单独可点击的，视当前列表所处的模式而定。",a39:"该操作允许用户把列表项拖动到列表中的其他位置。通常出现在列表编辑模式下。",a40:"重新排序图标是列表项的副操作。",a41:"展开/折叠",a42:"类型：副操作",a43:"单独可点击",a44:"垂直展开或折叠一个列表来显示或隐藏列表项的详细信息。",a45:"触摸列表控件，可以展开列表。",a46:"这个列表已经展开。",a47:"折叠的单行列表项",a48:"展开的单行列表项",a49:"滑动隐藏控件",a50:"类型：其他",a51:"滑动隐藏控件是当某一列表项被滑开之后的操作提示。滑动隐藏控件可以被转换成一项操作。",a52:"无论从哪个方向滑动列表，都会出现操作图标，滑动了之后，操作图标就会居中显示在列表空白处。",a53:"从右向左滑动一个列表项将会显示一个操作图标。",a54:"从左向右滑动一个列表项将会显示一个操作图标。",a55:"菜单是一种特殊类型的列表。在菜单中，使用适合于下拉菜单和弹出菜单的控件。不要在常规列表中使用这些控件。",a56:"选中",a57:"类型：状态",a58:"非单独可点击。",a59:"仅适用于菜单。用于表示当前列表项已被选中。",a60:"打勾表示列表项已被选中。",a61:"内联信息",a62:"类型：次要信息",a63:"非单独可点击。",a64:"仅适用于菜单。内联信息是列表中的一小段和当前标题相关的文字，用于提供相关信息或提示，比如快捷键。它不能被截断。",a65:"加粗、斜体和下划线等内联信息提供了快捷键。",a66:"嵌套菜单标识",a67:"类型：主操作",a68:"非单独可点击。",a69:"仅适用于菜单。该符号表示子菜单可以通过鼠标悬停、聚焦、选择等方式弹出。",a70:"菜单项中的符号表示子菜单会通过鼠标悬停、聚焦、选择等方式弹出。",a71:"Material Design 的列表控件用于提供列表项信息和操作",a72:"Material Design 列表控件的主要操作和状态布局指南",a73:"Material Design 中的复选框作为主操作和状态标识符",a74:"Material Design 中的复选框作为副操作",a75:"Material Design 中的开关为次要操作，支持单独点击",a76:"Material Design 中的重新排序图标用于列表项副操作",a77:"Material Design 的可展开触摸列表控件",a78:"Material Design 中已展开的列表",a79:"Material Design 中折叠的单行列表项",a80:"Material Design 中展开的单行列表项",a81:"Material Design 中滑动列表项显示操作图标",a82:"Material Design 中的操作图标通过滑动列表项显示",a83:"Material Design 中的勾选表示列表项已选中",a84:"Material Design 中的加粗、斜体和下划线信息",a85:"Material Design 中的子菜单通过悬停和选择弹出"};export{a as zhCn};
